import React from 'react';
import {CardMedia, Grid} from "@material-ui/core";
import StudentIcon from "../../../assets/student.png"

const SearchStudentSection = props => {
  return (
    <Grid container>
      <Grid item xs={4} />
      <Grid item xs={4}>
        <Grid container>
          <Grid item xs={4} />
          <Grid item xs={4}>
            <CardMedia style={styles.cardMedia} image={StudentIcon} />
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}

const styles = {
  cardMedia: {
    height: "120px",
    width: "120px",
    marginLeft: "auto",
    marginRight: "auto"
  }
}

export default SearchStudentSection;
